import {useEffect, useRef, useState} from 'react';
import classes from "./Header.module.css";
import {FaReact} from 'react-icons/fa';
import DropDownOne from './DropDownOne';
import {BsChevronDown} from 'react-icons/bs';
import Logo from "./logo.png";
import BimalenduName from "./BimalenduName.png";

import HeaderAddressBar from './HeaderAddressBar';


const  Header=(props)=> {

   const [showDropDownOne, setShowDropDownOne] = useState(false);
   const showDropDownOneHandler=()=>{
     setShowDropDownOne(true);
   }


   let activeColor="black";
   let inActiveColor="var(--themeColor)";


   const [homeButtonStyle, setHomeButtonStyle] = useState({color:inActiveColor});
   const [aboutButtonStyle, setAboutButtonStyle] = useState({color:inActiveColor})
   const [newsButtonStyle, setNewsButtonStyle] = useState({color:inActiveColor})
   const [contactUsButtonStyle, setContactButtonStyle] = useState({color:inActiveColor})
   const [homeBuyerButtonStyle, setHomeBuyerButtonStyle] = useState({color:inActiveColor});


   useEffect(()=>{

     props.homeMounted && setHomeButtonStyle({color:"var(--themeColor)"});
     !props.homeMounted && setHomeButtonStyle({color:"black"});


   },[props.homeMounted]);


   useEffect(()=>{

     props.aboutMounted && setAboutButtonStyle({color:"var(--themeColor)"});
     !props.aboutMounted && setAboutButtonStyle({color:"black"});


   },[props.aboutMounted]);



   useEffect(()=>{

     props.newsMounted && setNewsButtonStyle({color:"var(--themeColor)"});
     !props.newsMounted && setNewsButtonStyle({color:"black"});


   },[props.newsMounted]);


   useEffect(()=>{

     props.contactUsMounted && setContactButtonStyle({color:"var(--themeColor)"});
     !props.contactUsMounted && setContactButtonStyle({color:"black"});


   },[props.contactUsMounted]);



   useEffect(()=>{

     props.homeBuyerMounted && setContactButtonStyle({color:"var(--themeColor)"});
     !props.homeBuyerMounted && setContactButtonStyle({color:"black"});


   },[props.contactUsMounted]);














   console.log("props.homeMounted", props.homeMounted);






    return (
    <div className={classes.parentFooter}>

        <HeaderAddressBar/>

        {/* top Navigation bar */}
        <div className={classes.topNavigationBar}>
          <div className={classes.nFirstCotainer}>
            {/* <div className={classes.logo}>  */}
	       <img className={classes.logo} src={Logo} />

         <div className={classes.Name}>Bimalendu Pradhan</div>


	    {/* </div> */}
            {/*

	      <img src={BimalenduName}/>
	    </div>
	    */}
          </div>

          <div className={classes.navigationMenu}>

            <div className={classes.headerButtonDiv}>
              <button type="button" className={classes.headerButton} onClick={props.homeHandler} style={homeButtonStyle}>
                <div className={classes.HomeText}>Home</div>
              </button>
            </div>

            <div className={classes.headerButtonDiv}>
              <button type="button" className={classes.headerButton} onClick={props.aboutHandler} style={aboutButtonStyle}>
                <div className={classes.headerButtonText}>About</div>
              </button>
            </div>


	    <div className={classes.headerButtonDiv}>
              <button type="button" className={classes.headerButton} onClick={props.newsHandler} style={newsButtonStyle}>
                <div className={classes.headerButtonText}>News</div>
              </button>
            </div>



	    <div className={classes.headerButtonDiv}>
              <button type="button" className={classes.headerButton} onClick={showDropDownOneHandler}>
                <div className={classes.headerButtonText}><span>Home Buyer</span> <BsChevronDown size={15} style={{marginLeft:"5px"}}/></div>
              </button>
                  { showDropDownOne && 
	                         <DropDownOne setShowDropDownOne={setShowDropDownOne} /> 
		  }
            </div>


            <div className={classes.headerButtonDiv}>
              <button type="button" className={classes.headerButton} onClick={props.contactUsHandler} style={contactUsButtonStyle}>
                <div className={classes.headerButtonText}>Contact us</div>
              </button>
            </div>

          </div>
        </div>

    </div>


    );
}

export default Header;
